void ppu_copy( unsigned char* addr, unsigned int len )
{
    for( i = 0; i < len; i++ )
    {
        PPU_ADDRESS = 0x20;
        PPU_ADDRESS = i;
        PPU_DATA = i;//((unsigned char*) addr)[i];
    }
}

